import React from 'react';
import './Home.css';
import profileImage from '../assets/profile.png'; // Ensure this path is correct

const Home = () => {
  return (
    <section id="home" className="home">
      <div className="home-content">
        <div className="home-text">
          <p className="subtitle">Vascular Surgeon</p>
          <h1>Hi, I'm <span className="highlight">Dr. Amudhesh Sankaran</span></h1>
          <p className="location">Dedicated to Excellence in Healthcare</p>
        </div>
        <img src={profileImage} alt="Dr. Amudhesh Sankaran" className="profile-image"/>
      </div>
    </section>
  );
};

export default Home;
